import React from 'react';

// import '../css/app.css';

const Avatar = ({id , name , image}) => {
	return(
		<div className="ui card">
			<div className="image">
				<img src={image} alt="profile"></img>
			</div>
			<div className="content">
				<div className="header">
					{name}
				</div>
			</div>
			</div>
		);
}
 


export default Avatar;
